import React from 'react';
import './ImageCard.css';

const ImageCard = ({image, name}) => {
    return (
        
            <div className='card'>
            <div className='content'>
            
                <h4> 
                    {name}
                </h4>
               
            
            <hr style={{
                    backgroundColor:'grey'
                }}/>
            
            <img className='card-img singleImage' src={image} alt='card'/>
            </div>
           </div>
           
            
        
        
